import React, { Component } from 'react';

class ContactUs extends Component {
    render() {
        return (
            <div id="contact-us-main">
				<div id="contact-us-content">
					<section>
						<div className="container">
							<h3>Contact Us</h3>
						</div>
					</section>
				</div>
			</div>
        );
    }
}
